export default {
  name: "projectContent",
  type: "object",
  title: "Project Content",
  options: {
    collapsible: true,
    collapsed: true,
    columns: 1
  },
  fields: [
    {
      title: "Standard or custom?",
      name: "contentType",
      type: "string",
      options: {
        list: [
          { title: "Standard", value: "standard" },
          { title: "Custom", value: "custom" }
        ],
      },
    },
    {
      hidden: ({ parent }) => parent?.contentType !== "custom",
      name: "customContent",
      type: "markdown",
      title: "Custom content",
    },
  ],
};
